// FoodCard.js

import React, { useState } from "react";
import "./Foodcard.css"; // create a CSS file for styling

const FoodCard = ({ image, foodName, donorName, contact, location, quantity, quality, foodType, condition,onClose }) => {



  return (
    <div className="food-card" >
      <img src={image} alt={foodName} />
      <div className="card-details">
        <h3>{foodName}</h3>
        <p>Donor: {donorName}</p>
        <p>Contact: {contact}</p>
        <p>Location: {location}</p>
        
            <p>Quantity: {quantity}</p>
            <p>Quality: {quality}</p>
            <p>Food Type: {foodType}</p>
            <p>Condition: {condition}</p>
            <button className="red-btn" >Purchase</button>
          
      </div>
    </div>
  );
};

export default FoodCard;
